import React from 'react';
// import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
// import MenuItem from '@material-ui/core/MenuItem';
import TextField from '@material-ui/core/TextField';
import AccountTopBar from '../components/AccountTopBar';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import { Link } from 'react-router-dom';
import { useWavelet, useAccount, useContract } from 'react-use-wavelet';
import { Wavelet } from 'wavelet-client';
import JSBI from "jsbi";
// import { descriptions } from 'jest-config';
const BigInt = JSBI.BigInt;

const currencies = [
  {
    value: 'USD',
    label: '$',
  },
  {
    value: 'EUR',
    label: '€',
  },
  {
    value: 'BTC',
    label: '฿',
  },
  {
    value: 'JPY',
    label: '¥',
  },
];

const useStyles = makeStyles(theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing(12),
    marginRight: theme.spacing(0),
  },
  dense: {
    marginTop: theme.spacing(2),
  },
  menu: {
    width: 200,
  },
  itemGrid: {
      marginTop: 64,
  }
}));

const LogContainer = props =>  {
  const classes = useStyles();
    // const [contract] = useContract(client, 'dedba19fab890fe7e0c23b702b4229f824f31e76771932a0f635671123263d5e', onUpdate, onLoad);
    // const wallet = Wavelet.loadWalletFromPrivateKey('315f62c8f44fb6bf8351c9051b466ea93bf204706cc76a3878196caf253205f2d2b782d908775508aa65ecbc3327f78b200518623282bd75b617d72b07bc8612');
    // contract && contract.call(wallet, 'log_car', BigInt(0), BigInt(25000), BigInt(0), {
    //   type: 'string',
    //   value: owner
    // }, {
    //   type: 'string',
    //   value: vin
    // }, {
    //   type: 'string',
    //   value: description
    // }, {
    //   type: 'u32',
    //   value: odometer
    // }, {
    //   type: 'u32',
    //   value: id
    // });
  const [values, setValues] = React.useState({
    name: 'Cat in the Hat',
    age: '',
    multiline: 'Controlled',
    currency: 'EUR',
  });
  const manValid = false;
  const handleChange = name => event => {
    setValues({ ...values, [name]: event.target.value });
    if (values.name.length === 1) {
        // console.log(values.name);
        console.log('wrong');
        values.name=""
    }

    console.log(values.name);


  };

  return (
      <>
      <AccountTopBar/>
      <Grid 
        container 
        spacing={4} 
        justify='center' 
        className={classes.itemGrid}
    >
        <Grid item>
        <Typography variant="h4" gutterBottom>
            Car Log Form
        </Typography>
      </Grid>
      <Grid item>
    <form className={classes.container} noValidate autoComplete="off">
    <TextField
        id="outlined-error"
        label="Manufacturer"
        className={classes.textField}
        onChange={handleChange('name')}
        value={values.name}

        margin="normal"
        variant="outlined"
      />
      <TextField
        required
        id="outlined-required"
        label="Model"
        defaultValue=""
        className={classes.textField}
        margin="normal"
        variant="outlined"
      />
      <TextField
        required
        id="outlined-required"
        label="VIN"
        defaultValue=""
        className={classes.textField}
        margin="normal"
        variant="outlined"
      />
      <TextField
        required
        id="outlined-required"
        label="Registration Number"
        defaultValue=""
        className={classes.textField}
        margin="normal"
        variant="outlined"
      />
      <TextField
        required
        id="outlined-required"
        label="Odometer Reading"
        defaultValue=""
        className={classes.textField}
        margin="normal"
        variant="outlined"
      />
      <TextField
        required
        id="outlined-required"
        label="Owner's Name"
        defaultValue=""
        className={classes.textField}
        margin="normal"
        variant="outlined"
      />


    </form>
    </Grid>
    <Grid item>
    <Button 
          size="small" 
          color="primary"
          component={Link}
          to="/"
          onClick={() => {
            // savedPropsContext.addToSavedProps(props.id);
          }}
          >
          Save Car
        </Button>
    </Grid>
    </Grid>
    </>
  );
}

export default LogContainer;
